const Index = () => (
  <div>
    <div className = "centered">
      <h2>michael c. martinez</h2>
      <p>i am a web developer currently building things with <a href="https://dialup.digital">DIAL UP Digital</a></p>
      <a href="https://github.com/harsimus">github</a>
    </div>

    <style>
      {`
        html {
          position: relative;
          background-color: #000000;
        }

        body {
          margin: 0px !important;
          font-family: Helvetica, Arial, Sans-Serif;
          font-weight: bold;
          color: #FFFFFF;
        }

        a:link {
          color: linear-gradient(to bottom, #E45D14 0%, #E45D14 100%);
          text-decoration: none;
        }

        a:hover {
          color: linear-gradient(to bottom, #E45D14 0%, #ff99cc 100%);
          text-decoration: line-through;
        }

        .centered {
          position: fixed;
          top: 50%;
          left: 50%;
          transform: translate(-50%, -50%);
        }
      `}
    </style>
  </div>
);

export default Index;
